import React from "react";
import { Grid, Label, Box, Input, Textarea, Button, Flex, Image, Text } from "theme-ui";

const ProjectName = (props) => {
    return(
        <Box>
            <Text>{projectName}</Text>
        </Box>
    )
}

const ReviewBoxes = (props) => {
    return(
        <Flex sx={{backgroundColor: 'navy50', px: '10px', py: '30px', borderRadius: '10px', mb: '20px'}}>
            Body: {props.body}
            Rating: {props.rating}
            Author: {props.author}
            Project Name: {props.projectName}
        </Flex>
    )
}

export default ReviewBoxes;
